import React, {useState, useEffect} from "react";

function Ranking() {

    const [user, setUser] = useState("TEST");

    useEffect(() => {
        fetch('/dbTest')
        .then((res) => res.json())
        .then((data) => setUser(data.dbdata.id));
    },[])

    return (
        <div>
            <label>{user}</label>
        </div>
    );
}

export default Ranking;
